import React, {useState} from "react";

function AddProduct(){

    const [formvalue, setFormvalue] = useState({nome:'',valor:''});
    const handleInput =(e)=>{
        setFormvalue({...formvalue, [e.target.name]:e.target.value});
    };

    return(
        <React.Fragment>
        <div class="container">
            <h5>Adicionar Produto</h5>
            <form>
                <div class="mb-3">
                    <label for="exampleInputEmail1" class="form-label">Nome do produto:</label>
                    <input type="text" name="nome" class="form-control" id="nome" value={formvalue.nome} onChange={handleInput}/>
                </div>
                <div class="mb-3">
                    <label for="exampleInputPassword1" class="form-label">Valor:</label>
                    <input type="text" name="valor" class="form-control" id="valor"value={formvalue.valor} onChange={handleInput}/>
                </div>
                <button type="submit" class="btn btn-primary">Submit</button>
            </form>
        </div>
        </React.Fragment>
    );
}

export default AddProduct;
